{"bio":"The Chainsmokers is an American DJ duo consisting of Andrew Taggart and Alex Pall. The duo had a top twenty hit in several countries with their 2014 single "#Selfie" reaching number sixteen on the Billboard Hot 100, number three in Australia, and number eleven in the United Kingdom.
Several of the duo's singles such as "Roses" and "Don't Let Me Down" have become top-ten singles worldwide. They released their debut EP, Bouquet, in October 2015, while "Closer", featuring vocals from Halsey, became their first number-one single on both the Billboard Hot 100 and in the United Kingdom, having stayed in the top place for six weeks as of September 27, 2016.

